Battle Brunch - is a collection of 112 NFTs for PVP game on Solana!

How BATTLE BRUNCH work?

🗡️ Each NFTs have unique damage, the miss chance is assigned randomly, from 10% to 25% per round;
🗡️ The player need 3 wins with different opponents;
🗡️ After 3 victories, the player fights against the Game Boss;
🗡️ If player wins, the system buy floor price NFT (Battle Brunch collection) on ME and gives it to winner.
